import VueRouter from 'vue-router'
import SortPage from '../views/Sort.vue'
import HomePage from '../components/HomePage'
export default new VueRouter({
    routes:[
        {
            path:'/',
            name:'Home',
            component:HomePage,
            children:[
                {
                    path:'sort',
                    component:SortPage
                }
            ]
        }
    ]
})
